import React from 'react'
import fire from '../../config/fire'


class Home extends React.Component {

    constructor(props) {
        super(props);

        this.logout = this.logout.bind(this);
    }

    render() {
        return (
            <div>
                <h1>Home</h1>
            </div>
        )
    }

    logout() {
        fire.auth().signOut();
    }
}

export default Home
